{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/nicolasgonzalez1923/divvy-bikes-2022?scriptVersionId=167511508\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"0a96f693","metadata":{"papermill":{"duration":0.008943,"end_time":"2024-03-17T21:00:58.790341","exception":false,"start_time":"2024-03-17T21:00:58.781398","status":"completed"},"tags":[]},"source":["# Divvy Bikes Data Analysis using R\n","\n","### Scenario\n","In 2016, Cyclistic launched a successful bike-sharing program. Since then, the program has grown to a fleet of 5,824 georeferenced bicycles, stationed at 692 locations throughout Chicago. Bicycles can be unlocked from one station and returned to any other station in the system at any time. Customers who purchase single-ride or full-day passes are referred to as casual riders. Customers who buy annual memberships are called members riders. Cyclistic's financial analysts have concluded that annual members are much more profitable than casual riders, so it will be necessary to maximize the number of annual members for future growth.\n","\n","### Objective\n","Understanding the behavior or differences of casual riders compared to annual members and, in this way, providing concise and clear strategies to encourage them to want to obtain a subscription.\n"]},{"cell_type":"markdown","id":"229c47bd","metadata":{"papermill":{"duration":0.008023,"end_time":"2024-03-17T21:00:58.806498","exception":false,"start_time":"2024-03-17T21:00:58.798475","status":"completed"},"tags":[]},"source":["## Ask\n","* How do annual members and casual riders differ in their use of Cyclistic bikes?\n","* Why might casual riders buy annual memberships with Cyclistic?\n","* How can Cyclistic leverage digital media to influence casual riders to become members?\n","* Is there any prominent usage pattern, such as weekends versus weekdays?\n","* Are there any seasonal patterns that indicate key times for promotions?"]},{"cell_type":"markdown","id":"2460f08f","metadata":{"papermill":{"duration":0.007958,"end_time":"2024-03-17T21:00:58.822478","exception":false,"start_time":"2024-03-17T21:00:58.81452","status":"completed"},"tags":[]},"source":["## Prepare the data"]},{"cell_type":"markdown","id":"f642a766","metadata":{"papermill":{"duration":0.008475,"end_time":"2024-03-17T21:00:58.83894","exception":false,"start_time":"2024-03-17T21:00:58.830465","status":"completed"},"tags":[]},"source":["#### Load packages"]},{"cell_type":"code","execution_count":1,"id":"b009c026","metadata":{"_kg_hide-input":false,"_kg_hide-output":true,"execution":{"iopub.execute_input":"2024-03-17T21:00:58.858191Z","iopub.status.busy":"2024-03-17T21:00:58.8566Z","iopub.status.idle":"2024-03-17T21:00:59.784767Z","shell.execute_reply":"2024-03-17T21:00:59.783439Z"},"papermill":{"duration":0.939522,"end_time":"2024-03-17T21:00:59.786475","exception":false,"start_time":"2024-03-17T21:00:58.846953","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching core tidyverse packages\u001b[22m ──────────────────────── tidyverse 2.0.0 ──\n","\u001b[32m✔\u001b[39m \u001b[34mdplyr    \u001b[39m 1.1.3     \u001b[32m✔\u001b[39m \u001b[34mreadr    \u001b[39m 2.1.4\n","\u001b[32m✔\u001b[39m \u001b[34mforcats  \u001b[39m 1.0.0     \u001b[32m✔\u001b[39m \u001b[34mstringr  \u001b[39m 1.5.0\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2  \u001b[39m 3.4.4     \u001b[32m✔\u001b[39m \u001b[34mtibble   \u001b[39m 3.2.1\n","\u001b[32m✔\u001b[39m \u001b[34mlubridate\u001b[39m 1.9.3     \u001b[32m✔\u001b[39m \u001b[34mtidyr    \u001b[39m 1.3.0\n","\u001b[32m✔\u001b[39m \u001b[34mpurrr    \u001b[39m 1.0.2     \n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()